import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import SplashScreen from '../Pages/SplashScreen';

function App() {
  return (
   <BrowserRouter>
    <Routes>
      < Route path='/splashscreen' element={<SplashScreen/>} />
    </Routes>
   </BrowserRouter>
  );
}

export default App;
